import * as React from "react";
import Box from "@mui/material/Box";
import TextField from "@mui/material/TextField";
import Button from "@mui/material/Button";

class Form extends React.Component {
  constructor(props) {
    super(props);
    this.state = { pageNumbers: 10, page: 1, searchText: "" };
  }

  onTextFieldChange = (e) => {
    this.setState({ searchText: e.target.value });
  };

  render() {
    return (
      <Box
        component="form"
        sx={{
          display: "flex",
          flexDirection: "row",
          justifyContent: "space-around",
        }}
        noValidate
        autoComplete="off"
      >
        <TextField
          onChange={(e) => {
            onTextFieldChange(e);
          }}
          id="outlined-basic"
          label="Search Here"
          variant="outlined"
        />
        <Button variant="contained">Submit</Button>
      </Box>
    );
  }
}

export default Form;
